Tough laws mean nothing if you don’t enforce them. This is why DEMS should never be in charge of fixing problems. First rule of the executive branch…ENFORCE the laws on the books. 

@GavinNewsom — pretty much your whole job.

That is why we must pass federal legislation focused on coordinated enforcement of organized retail crime rings.

How can we keep offering 300,000 student visas to Chinese nationals every year when we KNOW they are legally required to gather intelligence for the CCP?

The answer is simple: we can't.

@StanfordReview's report on CCP espionage on campus should shock everyone and verify what I have been saying. We need to pass my STOP CCP Visas Act to protect our national security.

We have seen a 95 PERCENT decrease in illegal encounters at the border between this year and last.
 
It’s no secret why. 
 
@POTUS is making this country safer than ever before.

Ran into a very special Floridian at the Capitol today: National Champion @BennettAnd11.

We agree… GOTTA work hard to deliver wins for our state 🏀🐊

@UF https://t.co/Fvz3imVN12

The US spends more on education than most of its peers, yet only 30% of current high school students can read with proficiency upon graduation.

@usedgov has failed our children.

States should decide how to allocate funding. Florida ranks first in the nation for educational freedom and parental involvement. More school choice is a must for educational excellence.

Great to welcome some of our Florida Supreme Court Justices this afternoon in DC! 

Always good to see some friends from home. A little more sunshine in the Capitol is never bad.
@flcourts https://t.co/Ij3hn2aoj0

Our new U.S. Attorney General Pam Bondi isn’t wasting any time. Immediately after being sworn in, AG Bondi signed several orders to restore integrity and credibility at the DOJ. The new orders:
 
Defund sanctuary jurisdictions;
Open up a review of previous investigations into school parents;
Eliminate DEI;
Bring full weight of DOJ against drug cartels; and
Create a joint task force to investigate October 7.
 
It’s great to have an AG who puts #AmericaFirst.
